import React from "react";

const Form = () => {
	return (
		<React.Fragment>
			<form>
				<input className="" type='text' placeholder='Enter task' />
				<i class='fa fa-plus-circle' aria-hidden='true'></i>
			</form>
		</React.Fragment>
	);
};

export default Form;
